import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

// @material-ui/icons
import Info from "@material-ui/icons/Info";
import Chat from "@material-ui/icons/Chat";
import Build from "@material-ui/icons/Build";
// core components
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import CustomTabs from "components/CustomTabs/CustomTabs.js";

import styles from "assets/jss/material-kit-react/views/componentsSections/tabsStyle.js";

const useStyles = makeStyles(styles);

export default function SectionTabs() {
  const classes = useStyles();
  return (
    <div className={classes.section}>
      <div className={classes.container}>
        <div id="nav-tabs">
          <GridContainer>
            <GridItem xs={12} sm={12} md={40}>
              <h3>
                <small>Tabs with Icons on Card</small>
              </h3>
              <CustomTabs style={{height: "50px"}}
                headerColor="primary"
                tabs={[
                  {
                    tabName: "About Us",
                    tabIcon: Info,
                    tabContent: (
                      <p className={classes.textCenter}>
                        RUDRA is the official team of SRM IST taking part in University Rover Challenge <br></br>organised by Mars Society since 2013. 
                        The annual competition is held at the<br></br> Mars Desert Research Station (MDRS), Martian Analog Site, near Hanksville,<br></br> Utah, USA. 
                        The team has been successfully operational for the last 7 years and<br></br> has maintained its consistency in the competition. 
                        Our Team consists of 25-30<br></br> undergraduate students of every year from various engineering streams,<br></br> working in different domains. 
                        The fun part - R&D, is the soul and essence of<br></br> Team Rudra. Brainstorming discussions are always welcome for giving birth to<br></br> new ideas.

                              -The core of Team Rudra believes in giving an opportunity to everyone.
                      </p>
                    )
                  },
                  {
                    tabName: "Messages",
                    tabIcon: Chat,
                    tabContent: (
                      <p className={classes.textCenter}>
                        I think that’s a responsibility that I have, to push
                        possibilities, to show people, this is the level that
                        things could be at. I will be the leader of a company
                        that ends up being worth billions of dollars, because I
                        got the answers. I understand culture. I am the nucleus.
                        I think that’s a responsibility that I have, to push
                        possibilities, to show people, this is the level that
                        things could be at.
                      </p>
                    )
                  },
                  {
                    tabName: "Settings",
                    tabIcon: Build,
                    tabContent: (
                      <p className={classes.textCenter}>
                        think that’s a responsibility that I have, to push
                        possibilities, to show people, this is the level that
                        things could be at. So when you get something that has
                        the name Kanye West on it, it’s supposed to be pushing
                        the furthest possibilities. I will be the leader of a
                        company that ends up being worth billions of dollars,
                        because I got the answers. I understand culture. I am
                        the nucleus.
                      </p>
                    )
                  }
                ]}
              />
            </GridItem>
          </GridContainer>
        </div>
      </div>
    </div>
  );
}
